import{_ as a}from"./plugin-vue_export-helper.21dcd24c.js";import{o as i,c as l,d as e}from"./app.d6b42b88.js";var r="/blog/assets/dfs-bfs.9c80f7f2.png",s="/blog/assets/backtracking.4354bff5.png",n="/blog/assets/types-of-binary-tree.c4e09e0d.png",t="/blog/assets/binary-search-tree.17fe67e9.png",h="/blog/assets/heap.4994297d.png",d="/blog/assets/try.51c53299.png";const c={},o=e('<h2 id="\u1107\u1175\u1109\u1165\u11AB\u1112\u1167\u11BC-\u110C\u1161\u1105\u116D\u1100\u116E\u110C\u1169" tabindex="-1"><a class="header-anchor" href="#\u1107\u1175\u1109\u1165\u11AB\u1112\u1167\u11BC-\u110C\u1161\u1105\u116D\u1100\u116E\u110C\u1169" aria-hidden="true">#</a> \uBE44\uC120\uD615 \uC790\uB8CC\uAD6C\uC870</h2><p>\uB370\uC774\uD130 \uC694\uC18C\uAC00 \uC21C\uCC28\uC801\uC73C\uB85C \uBC30\uC5F4\uB418\uC9C0 \uC54A\uB294 \uC790\uB8CC\uAD6C\uC870\uB97C \uBE44\uC120\uD615 \uC790\uB8CC\uAD6C\uC870 \uB77C\uACE0 \uD55C\uB2E4. \uD0D0\uC0C9\uC774 \uBCF5\uC7A1\uD558\uACE0 \uC120\uD615\uC5D0 \uBE44\uD574 \uAD6C\uD604\uD558\uAE30\uB3C4 \uB2E4\uC18C \uBC88\uC7A1\uD558\uC9C0\uB9CC \uBA54\uBAA8\uB9AC\uB97C \uC880 \uB354 \uD6A8\uC728\uC801\uC73C\uB85C \uC0AC\uC6A9\uD560 \uC218 \uC788\uB2E4\uB294 \uC7A5\uC810\uC774 \uC788\uB2E4. \uB300\uD45C\uC801\uC73C\uB85C \uADF8\uB798\uD504\uB97C \uC608\uB85C \uB4E4 \uC218 \uC788\uB2E4.</p><p>\uADF8\uB798\uD504\uB780 \uAC1D\uCCB4\uC758 \uC77C\uBD80 \uC30D pair\uB4E4\uC774 \u2018\uC5F0\uAD00\uB418\uC5B4\u2019 \uC788\uB294 \uAC1D\uCCB4 \uC9D1\uD569\uAD6C\uC870\uB97C \uB9D0\uD55C\uB2E4 .</p><ul><li><p>\uC624\uC77C\uB7EC \uACBD\uB85C : \uBAA8\uB4E0 \uAC04\uC120\uC744 \uD55C\uBC88\uC529 \uBC29\uBB38\uD558\uB294 \uC720\uD55C\uADF8\uB798\uD504</p><ul><li>\uBAA8\uB4E0 \uC815\uC810\uC774 \uC9DD\uC218 \uAC1C\uC758 \uCC28\uC218\uB97C \uAC16\uB294 \uB2E4\uBA74 \uC131\uB9BD</li><li>\uAC04\uC120\uC744 \uAE30\uC900\uC73C\uB85C \uD55C\uB2E4.</li></ul></li></ul><ul><li><p>\uD574\uBC00\uD134 \uACBD\uB85C : \uAC01 \uC815\uC810\uC744 \uD55C \uBC88\uC529 \uBC29\uBB38\uD558\uB294 \uBB34\uD5A5 \uB610\uB294 \uC720\uD5A5 \uADF8\uB798\uD504 \uACBD\uB85C</p><ul><li>\uCD5C\uC801\uC54C\uACE0\uB9AC\uC998 \uC774\uC5C6\uB294 \uB300\uD45C\uC801\uC778 NP-complete(\uC644\uC804) \uBB38\uC81C</li><li>\uB2E4\uC2DC \uCD9C\uBC1C\uC810\uC73C\uB85C \uB3CC\uC544\uC624\uB294 \uACBD\uB85C \uD574\uBC00\uD134 \uC21C\uD658\uC774\uB77C\uACE0 \uBD80\uB978\uB2E4.</li><li>\uC815\uC810\uC744 \uAE30\uC900\uC73C\uB85C \uD55C\uB2E4</li></ul></li></ul><h2 id="_1-\u1100\u1173\u1105\u1162\u1111\u1173-\u1109\u116E\u11AB\u1112\u116C" tabindex="-1"><a class="header-anchor" href="#_1-\u1100\u1173\u1105\u1162\u1111\u1173-\u1109\u116E\u11AB\u1112\u116C" aria-hidden="true">#</a> 1. \uADF8\uB798\uD504 \uC21C\uD68C</h2><ul><li>\uADF8\uB798\uD504 \uD0D0\uC0C9\uC774\uB77C\uACE0\uB3C4 \uBD88\uB9AC\uBA70 \uADF8 \uADF8\uB798\uD504\uC758 \uC815\uC810\uC744 \uBC29\uBB38 \uD558\uB294 \uACFC\uC815\uC744 \uB9D0\uD55C\uB2E4.</li><li>\uAE4A\uC774\uC6B0\uC120\uD0D0\uC0C9 DFS(Depth First Serch)\uC640 \uB108\uBE44\uC6B0\uC120\uD0D0\uC0C9 BFS(Breadth-Firrst-Serch)\uC774 \uC788\uB2E4.</li></ul><h3 id="dfs" tabindex="-1"><a class="header-anchor" href="#dfs" aria-hidden="true">#</a> DFS</h3><p>\uD604\uC7AC \uC790\uC2E0\uC758 \uC704\uCE58\uC5D0\uC11C \uAC08 \uC218 \uC788\uB294 \uC5EC\uB7EC\uAC1C\uC758 \uB178\uB4DC \uC911 \uD558\uB098\uC758 \uB178\uB4DC\uB97C \uD0D0\uC0C9\uD558\uBA74\uC11C \uB354 \uC774\uC0C1 \uAC08 \uC218 \uC788\uB294 \uB178\uB4DC\uAC00 \uC5C6\uC744 \uB54C \uAE4C\uC9C0 \uD574\uB2F9 \uB178\uB4DC\uB97C \uD0C0\uACE0 \uB4E4\uC5B4\uAC00 \uAE4A\uAC8C \uD0D0\uC0C9\uD55C\uB2E4.</p><ul><li>\uC2A4\uD0DD\uC774\uB098 \uC7AC\uADC0\uB85C \uAD6C\uD604\uD55C\uB2E4.</li><li>\uBC31\uD2B8\uB808\uD0B9\uC744 \uD1B5\uD574 \uB6F0\uC5B4\uB0D4 \uD6A8\uC6A9 \uBCF4\uC778\uB2E4</li></ul><h3 id="bfs" tabindex="-1"><a class="header-anchor" href="#bfs" aria-hidden="true">#</a> BFS</h3><p>\uAC00\uC7A5 \uAC00\uAE4C\uC6B4 \uACF3\uB4E4\uC744 \uBA3C\uC800 \uD0D0\uC0C9\uD558\uACE0, \uBA40\uB9AC \uB5A8\uC5B4\uC838 \uC788\uB294 \uB178\uB4DC\uB97C \uB098\uC911\uC5D0 \uD0D0\uC0C9\uD558\uB294 \uBC29\uBC95\uC774\uB2E4. \uD604\uC7AC \uC790\uC2E0\uC758 \uC704\uCE58\uC5D0\uC11C \uAC08 \uC218 \uC788\uB294 \uBAA8\uB4E0 \uB178\uB4DC\uB97C \uD55C\uBC88\uC529 \uD0D0\uC0C9\uD55C \uB4A4 \uB2E4\uC2DC \uC5F0\uACB0\uB418\uC5B4 \uC788\uB294 \uBAA8\uB4E0 \uAE38\uC744 \uB113\uAC8C \uD0D0\uC0C9\uD55C\uB2E4.</p><ul><li>\uC8FC\uB85C \uD050\uB85C \uAD6C\uD604\uD55C\uB2E4.</li><li>\uADF8\uB798\uD504\uC758 \uCD5C\uB2E8\uACBD\uB85C\uB97C \uAD6C\uD558\uB294 \uBB38\uC81C\uB098 \uBB34\uD55C\uD55C \uACBD\uB85C \uD0D0\uC0C9 \uB4F1\uC5D0 \uC0AC\uC6A9 \uB41C\uB2E4 .</li><li>\uC7AC\uADC0\uB85C \uB3D9\uC791\uD558\uC9C0 \uC54A\uB294\uB2E4.</li></ul><p><img src="'+r+'" alt="dfs&amp;bfs" loading="lazy"></p><h3 id="\u1107\u1162\u11A8\u1110\u1173\u1105\u1162\u110F\u1175\u11BC" tabindex="-1"><a class="header-anchor" href="#\u1107\u1162\u11A8\u1110\u1173\u1105\u1162\u110F\u1175\u11BC" aria-hidden="true">#</a> \uBC31\uD2B8\uB798\uD0B9</h3><ul><li>\uD574\uACB0\uCC45\uC5D0 \uB300\uD55C \uD6C4\uBCF4\uB97C \uAD6C\uCD95\uD574 \uB098\uAC00\uC544\uAC00 \uAC00\uB2A5\uC131\uC774 \uC5C6\uB2E4\uACE0 \uD310\uB2E8\uB418\uB294 \uC989\uC2DC \uD6C4\uBCF4\uB97C \uD3EC\uAE30(\uBC31\uD2B8\uB808\uD0B9,Backtrack)\uD574 \uC815\uB2F5\uC744 \uCC3E\uC544\uAC00\uB294 \uBC95\uC6A9\uC801\uC778 \uC54C\uACE0\uB9AC\uC998\uC73C\uB85C \uC81C\uC57D\uCDA9\uC871\uBB38\uC81C\uC5D0 \uD2B9\uD788 \uC720\uC6A9\uD558\uB2E4.</li><li>DFS \uB294 \uBC31\uD2B8\uB808\uD0B9\uC758 \uACE8\uACA9\uC744 \uC774\uB8EC\uB2E4. \uBC31\uD2B8\uB808\uD0B9\uC740 \uC8FC\uB85C \uC7AC\uADC0\uB85C \uAD6C\uD604\uD55C\uB2E4.</li><li>\uAC00\uBCF4\uACE0 \uB418\uB3CC\uC544\uC624\uACE0\uB97C \uBC18\uBCF5\uD558\uAE30 \uB54C\uBB38\uC5D0 \uCD5C\uC545\uC758 \uACBD\uC6B0\uB294 \uBAA8\uB4E0 \uACBD\uC6B0\uB97C \uB2E4 \uAC70\uCE5C\uB2E4\uC74C\uC5D0 \uB3C4\uCC29\uD560 \uC218 \uC788\uB2E4. \uC790\uCE6B \uBE0C\uB8E8\uD2B8 \uD3EC\uC2A4\uC640 \uC720\uC0AC\uD558\uC9C0\uB9CC \uD55C\uBC88 \uBC29\uBB38 \uD6C4 \uAC00\uB2A5\uC131 \uC5C6\uB294 \uACBD\uC6B0 \uC989\uC2DC \uD6C4\uBCF4\uB97C \uD3EC\uAE30\uD55C\uB2E4\uB294 \uC810\uC5D0\uC11C \uB9E4\uBC88 \uAC19\uC740 \uACBD\uB85C \uBC29\uBB38\uD558\uB294 \uBE0C\uB8E8\uD2B8 \uD3EC\uC2A4 \uBCF4\uB2E4\uB294 \uC6B0\uC544\uD558\uB2E4.</li><li>\uD2B8\uB9AC\uC758 \uBD88\uD544\uC694\uD55C \uBD80\uBD84\uC744 \uBC84\uB9AC\uB294 \uAC83\uC744 \uD2B8\uB9AC \uAC00\uC9C0\uCE58\uAE30(pruning) \uD55C\uB2E4\uACE0 \uD55C\uB2E4.</li></ul><p><img src="'+s+'" alt="backtrack" loading="lazy"></p><div class="custom-container info"><p class="custom-container-title">\uC81C\uC57D \uCDA9\uC871 \uBB38\uC81C</p><ul><li>\uC81C\uC57D \uCDA9\uC871 \uBB38\uC81C\uB780 \uC218\uB9CE\uC740 \uC81C\uC57D\uC870\uAC74\uC744 \uCDA9\uC871\uD558\uB294 \uC0C1\uD0DC\uB97C \uCC3E\uC544\uB0B4\uB294 \uC218\uD559\uBB38\uC81C\uB97C \uB9D0\uD55C\uB2E4</li><li>\uBC31\uD2B8\uB808\uD0B9\uC740 \uC81C\uC57D\uCDA9\uC871\uBB38\uC81C\uB97C \uD480\uC774\uD558\uB294\uB370 \uD544\uC218\uC801\uC778 \uC54C\uACE0\uB9AC\uC998\uC774\uB2E4. \uAC00\uC9C0\uCE58\uAE30\uB97C \uD1B5\uD574 \uC81C\uC57D \uCDA9\uC871 \uBB38\uC81C\uB97C \uCD5C\uC801\uD654 \uD558\uAE30 \uB54C\uBB38\uC774\uB2E4.</li></ul></div><h2 id="_2-\u1110\u1173\u1105\u1175" tabindex="-1"><a class="header-anchor" href="#_2-\u1110\u1173\u1105\u1175" aria-hidden="true">#</a> 2. \uD2B8\uB9AC</h2><ul><li>\uD2B8\uB9AC\uB294 \uC7AC\uADC0\uB85C \uC815\uC758\uB41C \uC790\uAE30 \uCC38\uC870 \uC790\uB8CC\uAD6C\uC870\uC774\uB2E4. \uB8E8\uD2B8 \uAC12\uACFC \uBD80\uBAA8-\uC790\uC2DD\uAD00\uACC4\uC758 \uC11C\uBE0C\uD2B8\uB9AC\uB85C \uAD6C\uC131\uB418\uBA70 \uC11C\uB85C \uC5F0\uACB0\uB41C \uB178\uB4DC\uC758 \uC9D1\uD569\uC774\uB2E4.</li></ul><ul><li>\uADF8\uB798\uD504\uC640 \uD2B8\uB9AC\uC758 \uCC28\uC774\uC810\uC740? \uD2B8\uB9AC\uB294 \uC21C\uD658 \uAD6C\uC870\uB97C \uAC16\uC9C0 \uC54A\uB294 \uADF8\uB798\uD504\uC774\uB2E4. \uADF8\uB798\uD504\uB294 \uB2E8\uBC29\uD5A5\uC774 \uB420\uC218\uB3C4 \uC591\uBC29\uD5A5\uC774 \uB420 \uC218\uB3C4 \uC788\uC9C0\uB9CC \uD2B8\uB9AC\uB294 \uBD80\uBAA8\uB178\uB4DC\uC5D0\uC11C \uC790\uC2DD\uB178\uB4DC\uB97C \uAC00\uB974\uD0A4\uB294 \uB2E8\uBC29\uD5A5\uBFD0\uC774\uB2E4. \uB610\uD55C \uD2B8\uB9AC\uB294 \uD558\uB098\uC758 \uBD80\uBAA8\uB178\uB4DC\uB97C \uAC00\uC9C0\uACE0 \uC788\uC73C\uBA70 \uB8E8\uD2B8 \uB610\uD55C \uD558\uB098\uC5EC\uC57C\uD55C\uB514.</li></ul><h3 id="\u110B\u1175\u110C\u1175\u11AB-\u1110\u1173\u1105\u1175" tabindex="-1"><a class="header-anchor" href="#\u110B\u1175\u110C\u1175\u11AB-\u1110\u1173\u1105\u1175" aria-hidden="true">#</a> \uC774\uC9C4 \uD2B8\uB9AC</h3><p>\uD2B8\uB9AC\uAC00 m\uAC1C \uC774\uD558 \uC790\uC2DD\uB178\uB4DC \uAC00\uC9C0\uACE0 \uC788\uC73C\uBA74 m-ary\uD2B8\uB9AC(\uB2E4\uD56D\uD2B8\uB9AC)\uB77C\uACE0 \uD55C\uB2E4. \uC774\uB54C m=2\uC778 \uACBD\uC6B0, \uBAA8\uB4E0 \uB178\uB4DC\uC758 \uCC28\uC218\uAC00 2 \uC774\uD558 \uC77C\uB54C\uB294 \uC774\uC9C4 \uD2B8\uB9AC\uB77C\uACE0 \uBD80\uB978\uB2E4. \uC544\uB798\uB294 \uC774\uC9C4\uD2B8\uB9AC\uC758 \uD0C0\uC785\uC774\uB2E4.</p><p><img src="'+n+'" alt="types-of-binary-tree" loading="lazy"></p><ul><li>\uC815 \uC774\uC9C4 \uD2B8\uB9AC(Full Binary Tree) : \uBAA8\uB4E0 \uB178\uB4DC\uAC00 0\uAC1C \uB610\uB294 2\uAC1C\uC758 \uC790\uC2DD\uB178\uB4DC\uB97C \uAC16\uB294\uB2E4.</li><li>\uC644\uC804 \uC774\uC9C4 \uD2B8\uB9AC(Complate Binary Tree) : \uB9C8\uC9C0\uB9C9 \uB808\uBCA8\uC744 \uC81C\uC678\uD558\uACE0 \uBAA8\uB4E0 \uB808\uBCA8\uC774 \uC644\uC804\uD788 \uCC44\uC6CC\uC838 \uC788\uC73C\uBA74 \uB9C8\uC9C0\uB9C9 \uB808\uBCA8\uC758 \uBAA8\uB4E0 \uB178\uB4DC\uD2B8 \uAC00\uC7A5 \uC67C\uCABD\uBD80\uD130 \uCC44\uC6CC\uC838 \uC788\uB2E4.</li><li>\uD3EC\uD654 \uC774\uC9C4 \uD2B8\uB9AC(Perfect Binary Tree) : \uBAA8\uB4E0 \uB178\uB4DC\uAC00 2\uAC1C\uC758 \uC790\uC2DD \uB178\uB4DC\uB97C \uAC16\uACE0 \uC788\uC73C\uBA70, \uBAA8\uB4E0 \uB9AC\uD504 \uB178\uB4DC\uAC00 \uB3D9\uC77C\uD55C \uAE4A\uC774\uB97C \uAC16\uB294\uB2E4.</li></ul><h3 id="\u110B\u1175\u110C\u1175\u11AB-\u1110\u1161\u11B7\u1109\u1162\u11A8-\u1110\u1173\u1105\u1175-bst" tabindex="-1"><a class="header-anchor" href="#\u110B\u1175\u110C\u1175\u11AB-\u1110\u1161\u11B7\u1109\u1162\u11A8-\u1110\u1173\u1105\u1175-bst" aria-hidden="true">#</a> \uC774\uC9C4 \uD0D0\uC0C9 \uD2B8\uB9AC(BST)</h3><p>\uC55E\uC11C \uB9D0\uD55C \uC774\uC9C4 \uD2B8\uB9AC\uB294 \uC815\uB82C \uC5EC\uBD80\uC640 \uAD00\uACC4 \uC5C6\uC774 \uBAA8\uB4E0 \uB178\uB4DC\uAC00 \uB458 \uC774\uD558\uC758 \uC790\uC2DD\uC744 \uAC16\uB294 \uB2E8\uC21C\uD55C \uD2B8\uB9AC\uD615\uD0DC\uC600\uB2E4. \uC774\uC9C4 \uD0D0\uC0C9 \uD2B8\uB9AC(Binary Search Tree)\uB780 \uC815\uB82C\uB41C \uD2B8\uB9AC\uB97C \uB9D0\uD55C\uB2E4. \uC774\uC9C4 \uD0D0\uC0C9 \uD2B8\uB9AC\uB294 \uB178\uB4DC\uC758 \uC67C\uCABD \uC11C\uBE0C\uD2B8\uB9AC\uC5D0\uB294 \uADF8 \uB178\uB4DC\uC758 \uAC12\uBCF4\uB2E4 \uC791\uC740 \uAC12\uB4E4\uC744 \uC9C0\uB2CC \uB178\uB4DC\uB4E4\uB85C \uC774\uB904\uC838 \uC788\uACE0 \uC624\uB978\uCABD \uC11C\uBE0C\uD2B8\uB9AC\uC5D0\uB294 \uADF8 \uB178\uB4DC\uC758 \uAC12\uACFC \uAC19\uAC70\uB098 \uD070 \uAC12\uB4E4\uB85C \uC774\uB8E8\uC5B4\uC838\uC788\uB2E4. \uC774 \uD2B8\uB9AC\uB294 \uB180\uB78D\uAC8C\uB3C4 \uD0D0\uC0C9\uC2DC \uC2DC\uAC04 \uBCF5\uC7A1\uB3C4\uAC00 O(log n)\uC774\uB2E4. \uC774\uC9C4 \uD0D0\uC0C9 \uD2B8\uB9AC\uB294 \uB85C\uADF8\uC758 \uAC15\uB825\uD568\uC744 \uC798 \uD45C\uD604\uD55C\uB2E4.</p><p>\uC544\uB798 \uADF8\uB9BC\uCC98\uB7FC \uC6B4\uC774 \uB098\uC058\uAC8C \uBE44\uD6A8\uC728\uC801\uC73C\uB85C \uAD6C\uC131\uB41C \uC774\uC9C4 \uD0D0\uC0C9 \uD2B8\uB9AC\uB294 \uC804\uD600 \uD6A8\uC728\uC801\uC774\uC9C0 \uC54A\uB2E4. \uAC80\uC0C9\uC2DC O(n)\uC758 \uC2DC\uAC04\uC774 \uAC78\uB9AC\uBA74\uC11C \uC5F0\uACB0\uB9AC\uC2A4\uD2B8\uC640 \uB2E4\uB974\uC9C0 \uC54A\uC544\uC9C4\uB2E4. \uC774\uB7F0 \uD2B8\uB9AC\uB294 \uADE0\uD615\uC744 \uB9DE\uCDB0\uC904 \uD544\uC694\uAC00 \uC788\uB2E4. \uC774\uB97C \uC704\uD574 \uACE0\uC548\uD574 \uB0B8\uAC8C \uC790\uAC00 \uADE0\uD615 \uC774\uC9C4 \uD0D0\uC0C9 \uD2B8\uB9AC(Self Balancing Search Tree)\uC774\uB2E4. \uB300\uD45C\uC801\uC73C\uB85C \uB808\uB4DC-\uBE14\uB799 \uD2B8\uB9AC\uAC00 \uC788\uB2E4.<br><img src="'+t+'" alt="binary-search-tree" loading="lazy"></p><h2 id="_3-\u1112\u1175\u11B8" tabindex="-1"><a class="header-anchor" href="#_3-\u1112\u1175\u11B8" aria-hidden="true">#</a> 3. \uD799</h2><ul><li>\uD799\uC758 \uD2B9\uC131(\uCD5C\uC18C \uD799 \uC5D0\uC11C\uB294 \uBD80\uBAA8\uAC00 \uD56D\uC0C1 \uC790\uC2DD\uBCF4\uB2E4 \uC791\uAC70\uB098 \uAC19\uB2E4)\uB97C \uB9CC\uC871\uD558\uB294 \uAC70\uC758 \uC644\uC804\uD55C \uD2B8\uB9AC\uC778 \uD2B9\uC218\uD55C \uD2B8\uB9AC\uAE30\uBC18\uC758 \uC790\uB8CC\uAD6C\uC870 \uC774\uB2E4.</li><li><strong>\uD799\uC740 \uC815\uB82C\uB41C \uC790\uB8CC\uAD6C\uC870\uAC00 \uC544\uB2C8\uB2E4.</strong> \uBD80\uBAA8\uB178\uB4DC\uAC00 \uD56D\uC0C1 \uC790\uC2DD\uBCF4\uB2E4 \uC791\uB2E4\uB294 \uC870\uAC74\uB9CC \uB9CC\uC871\uD560 \uBFD0\uC774\uB2E4. \uBD80\uBAA8-\uC790\uC2DD\uAC04\uC758 \uAD00\uACC4\uB9CC \uC815\uB82C\uD558\uACE0 \uC88C-\uC6B0 \uAC04\uC758 \uAD00\uACC4\uB294 \uC815\uB82C\uB418\uC5B4\uC788\uC9C0 \uC54A\uB2E4.</li><li>\uC6B0\uC120\uC21C\uC704 \uD050\uC5D0\uC11C \uAC00\uC7A5 \uC791\uC740 \uAC12\uC744 \uAC00\uC838\uC624\uB294 \uAC83\uC740 \uB9E4\uBC88 \uD799\uC758 \uB8E8\uD2B8\uB97C \uAC00\uC838\uC624\uB294 \uD615\uD0DC\uB85C \uAC00\uC838\uC628\uB2E4(\uCD5C\uC18C \uD799\uC758 \uACBD\uC6B0) <img src="'+h+'" alt="heap" loading="lazy"></li></ul><div class="custom-container info"><p class="custom-container-title">\uC774\uC9C4 \uD799 vs \uC774\uC9C4 \uD0D0\uC0C9 \uD2B8\uB9AC</p><p>\uC774\uC9C4 \uD799\uACFC \uC774\uC9C4 \uD0D0\uC0C9 \uD2B8\uB9AC\uB294 \uD5F7\uAC08\uB9B4 \uC218 \uC788\uB2E4. \uCC28\uC774\uC810\uC744 \uC815\uB9AC\uD558\uBA74 \uB2E4\uC74C\uACFC \uAC19\uB2E4.</p><ul><li>\uD799\uC740 \uC0C1/\uD558 \uAD00\uACC4\uB97C \uBCF4\uC7A5\uD558\uBA70 BST\uB294 \uC88C/\uC6B0 \uAD00\uACC4\uB97C \uBCF4\uC7A5\uD55C\uB2E4.</li><li>\uD799(\uCD5C\uC18C \uD799 \uAE30\uC900)\uC740 \uC5B8\uC81C\uB098 \uBD80\uBAA8\uAC00 \uC790\uC2DD\uBCF4\uB2E4 \uC791\uB2E4. BST\uB294 \uBD80\uBAA8\uAC00 \uC67C\uCABD\uC790\uC2DD\uBCF4\uB2E4\uB294 \uD06C\uBA70 \uC624\uB978\uCABD \uC790\uC2DD\uBCF4\uB2E4\uB294 \uC791\uAC70\uB098 \uAC19\uB2E4.</li><li>BST\uB294 \uD0D0\uC0C9\uACFC \uC0BD\uC785\uC774 \uBAA8\uB450 O(log n)\uC5D0 \uAC00\uB2A5\uD558\uBA70 \uBAA8\uB4E0 \uAC12\uC774 \uC815\uB82C\uB418\uC5B4\uC57C \uD560 \uB54C \uC0AC\uC6A9\uD55C\uB2E4. \uD799\uC740 \uAC00\uC7A5 \uD070 \uAC12\uC744 \uCD94\uCD9C\uD558\uAC70\uB098 \uAC00\uC7A5 \uC791\uC740 \uAC12\uC744 \uCD94\uCD9C\uD558\uB824 \uD560 \uB54C \uC0AC\uC6A9\uD55C\uB2E4. \uD799\uC740 \uC774 \uC791\uC5C5\uC774 O(1)\uC774\uB2E4.<br> (\uCD94\uCD9C \uD6C4 \uC7AC\uC815\uB82C\uC740 O(log n))</li></ul></div><h2 id="\u1110\u1173\u1105\u1161\u110B\u1175" tabindex="-1"><a class="header-anchor" href="#\u1110\u1173\u1105\u1161\u110B\u1175" aria-hidden="true">#</a> \uD2B8\uB77C\uC774</h2><ul><li>\uAC80\uC0C9 \uD2B8\uB9AC\uC758 \uC77C\uC885\uC73C\uB85C \uC77C\uBC18\uC801\uC73C\uB85C \uD0A4\uAC00 \uBB38\uC790\uC5F4\uC778 \uB3D9\uC801 \uBC30\uC5F4 \uB610\uB294 \uC5F0\uAD00 \uBC30\uC5F4\uC744 \uC800\uC7A5\uD558\uB294\uB370 \uC0AC\uC6A9\uB418\uB294 \uC815\uB82C\uB41C \uC790\uB8CC\uAD6C\uC870\uB2E4.</li><li>\uC790\uC5F0\uC5B4 \uCC98\uB9AC \uBD84\uC57C\uC5D0\uC11C \uBB38\uC790\uC5F4 \uD0D0\uC0C9\uC744 \uC704\uD55C \uC790\uB8CC\uAD6C\uC870\uB85C \uB110\uB9AC\uC4F0\uC778\uB2E4.</li><li>\uAC01\uAC01\uC758 \uBB38\uC790\uB2E8\uC704\uB85C \uC0C9\uC778\uC744 \uAD6C\uCD95\uD55C \uAC83\uACFC \uBE44\uC2B7\uD55C\uB370, \uB2E8\uC5B4 apple\uC744 \uCC3E\uB294 \uB2E4\uBA74 5\uBC88 \uB9CC\uC5D0 \uBB38\uC790\uC5F4\uC758 \uC874\uC7AC\uC5EC\uBD80 \uD30C\uC545\uC774 \uAC00\uB2A5\uD558\uB2E4. <img src="'+d+'" alt="try" loading="lazy"></li></ul><h2 id="reference" tabindex="-1"><a class="header-anchor" href="#reference" aria-hidden="true">#</a> Reference</h2><p>\uD30C\uC774\uC36C \uC54C\uACE0\uB9AC\uC998 \uC778\uD130\uBDF0(\uCC45\uB9CC)</p>',35),p=[o];function u(f,_){return i(),l("div",null,p)}var m=a(c,[["render",u],["__file","non-linear.html.vue"]]);export{m as default};
